2^{10}-2^8 &= 2^8(2^{2}-1) \\
&= 2^8(3)
\end{align*} The denominator $2^7-2^6$ can be similarly factored: \begin{align*}
2^7-2^6 &= 2^6(2^{1}-1) \\
&= 2^6(1)
\end{align*} Therefore, the expression becomes: \begin{align*}
\frac{2^{10}-2^8}{2^7-2^6} &= \frac{2^8(3)}{2^6(1)} \\
&= \frac{2^8}{2^6} \cdot 3 \\
&= 2^2 \cdot 3
\end{align*} Finally, we simplify the expression to find the answer: \begin{align*}
2^2 \cdot 3 &= 4 \cdot 3 \\
&= \boxed{12}.
\end{align*}
